import ExpenseItem from "./ExpenseItem"
import './ExpenseItem'

export default function ExpenseItems(props) {

return (
    <>
        {props.items.map(
            <ExpenseItem title={props.items.title} amount={props.items.amount} date={props.items.date} />
        )}
    </>
    )
}
